import React, {useState} from 'react';
import {FormControl, FormGroup, FormControlLabel, Checkbox} from '@material-ui/core';

export const CheckboxesGroup = ({ values, onChange }) => {
  console.log(values);

  return (
    <div className="checkbox-container">
      <FormControl component="fieldset">
        <FormGroup>
          <FormControlLabel
            control={<Checkbox values={values} onChange={onChange('offers')} />}
            label="Do you want to know about our special offers?"
          />
          <FormControlLabel
            control={<Checkbox values={values} onChange={onChange('news')} />}
            label="What about news from us?"
          />
        </FormGroup>
      </FormControl>
    </div>
  );
};
